// App.js

import React, { Component } from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { Button, View, Text } from "react-native";

import Home from "./screens/Home";
import Fitnessplan from "./screens/Fitnessplan";
import Fitnessinfo from "./screens/Fitnessinfo";
import Login from "./screens/Login";

import credentials from "./screens/data/credentials.json";

const Stack = createStackNavigator();

function handleLogin() {
  //console.log(this.props.history);
  fetch("http://localhost:9000/api/login", {
    method: "POST",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
    body: JSON.stringify({
      username: this.state.username,
      password: this.state.password,
    }),
  })
    .then((res) => res.json())
    .then((response) => {
      const token = response.token;
      this.setState({
        token: token,
      });
      localStorage.setItem("token", this.state.token);
      if (token != null)
        this.setState({
          isLoggedIn: true,
        });
      // history.push("/FitnessInfoAdmin");
      console.log("Eingeloggt");
    })

    .catch((err) => console.log(err));
}

function handleLogout() {
  localStorage.removeItem("token");
  this.setState({
    isLoggedIn: false,
  });
  console.log("Ausgeloggt");
}
function NavStack(navigation) {
  return (
    <Stack.Navigator
      screenOptions={{
        headerTitleAlign: "center",
        headerStyle: {
          backgroundColor: "#621FF7",
        },
        headerTintColor: "#fff",
        headerTitleStyle: {
          fontWeight: "bold",
        },
      }}
    >
      <Stack.Screen
        name="Home"
        component={Home}
        options={{
          title: "Home",
        }}
      />
      <Stack.Screen
        name="Fitnessplan"
        component={Fitnessplan}
        options={{ title: "Fitnessplan" }}
      />
      <Stack.Screen
        name="Fitnessinfo"
        component={Fitnessinfo}
        options={{ title: "Fitnessinfo" }}
      />
      <Stack.Screen
        name="Login"
        component={Login}
        options={{ title: "Login" }}
      />
    </Stack.Navigator>
  );
}

export default class App extends Component {
  render() {
    return (
      <NavigationContainer>
        <NavStack />
      </NavigationContainer>
    );
  }
}
